import React from 'react';
import './Setting.css';
import { Route, Link } from 'react-router-dom';
import General from './General.jsx';
import SecurityAndLogin from './SecurityAndLogin';
import { Col } from 'antd';


function Setting() {
    return (
        <>
            <div className="container" >
                <Col span={6}>
                    <General />
                </Col>
                <Col span={6}>
                    <div className="setting-content" style={{ margin: '20px 0' }}>
                        <Route exact path="/setting" component={General} />
                        <Route path="/setting/securityandlogin" component={SecurityAndLogin} />

                    </div>
                </Col>


            </div>
        </>
    )
}

export default Setting;
